import './Header.css';
import logo from '../images/logo.png';
import unb_logo from '../images/unb_logo.jpg';
import { Link } from "react-router-dom";

function Header() {
    return(
        <header>
            <div class="logo">
                <Link to="/home">
                    <img src={unb_logo} alt="logo UnB" class="unb_logo" width={150}/>
                </Link>
                <img src={logo} alt="logo observatório de energia" width={50}/>
            </div>
            <nav>
                <ul>
                    <li><a href="#body">Página Inicial</a></li>
                    <li><a href="#quem_somos">Quem somos</a></li>
                    <li><a href="bancoDados.html">Banco de dados</a></li>
                    <li><a href="#prof">Professores</a></li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
